SpotiApp will download your playlists from Apple Music, Deezer, Google, Youtube and other popular music applications to Spotify.

START:
- go to any service that has a playlist you need;
- take a screenshot;
- upload a screenshot to SpotiApp;
- SpotiApp recognizes your music tracks by picture;
- click "Transfer to Spotify" - the list will be saved in Spotify under "Favorite tracks";
- enjoy!

Коллекторы, банки, МФО, колл-центры, реклама, мошенники и разводилы больше не будут проблемой. Благодаря интеграции с системой Вы будете в курсе откуда звонят и увидите информацию о нежелательном абоненте еще до снятия трубки, в истории звонков и при наборе номера. С помощью приложения вы также сможете узнать регион и оператора номера (с учетом переноса номера – MNP, данные ЦНИИС).

Не хотите чтобы нежелательные абоненты беспокоили Вас? Просто заблокируйте их звонки одним нажатием в приложении!

■ Ключевые особенности нашего приложения ■
• самая полная и надежная база нежелательных абонентов – чёрный список из более 400'000 ПРОВЕРЕННЫХ номеров мошенников, разводил, коллекторов и коллекторских агентств, банков, МФО, колл-центров, продавцов и т.п.;
• ежедневные обновления базы;
• самый мощный функционал из доступных в App Store;
• фильтрация SMS – по номеру или маске;
• личные "чёрный" и "белый" списки номеров;
• возможность поделиться номерами из "чёрного" списка с сообществом;
• простое и мгновенное определение оператора, региона, страны номера и дополнительной информации в интерфейсе приложения (для номеров России используются открытые данные реестра Россвязи);
• учет переноса номеров между операторами (MNP), данные ЦНИИС;
• полная интеграция с приложением Телефон – определитель номера входящего звонка, определитель неизвестного номера в истории звонков и пропущенных вызовов, проверка по базе при наборе номера;
• блокировка звонков нежелательных абонентов, сразу всех или отдельных категорий;
• простой и понятный, но в то же время мощный интерфейс;
• панель управления с быстрым доступом к нужным функциям;
• полная поддержка начиная с iPhone 5/5С и выше.

■ ВАЖНО ■
• Определение региона, оператора, страны возможно ТОЛЬКО через интерфейс приложения. Определять эту информацию во время самого звонка НЕЛЬЗЯ из-за технических ограничений iOS (и в App Store НЕТ приложений, которые бы позволили это сделать). Мы ведем переговоры с Apple об изменении функционала iOS, чтобы реализовать такое определение.
• Определение номеров осуществляется по нашей базе нежелательных абонентов. 
• Определять и блокировать скрытые номера НЕЛЬЗЯ из-за технических ограничений iOS (и в App Store НЕТ приложений, которые бы позволили это сделать). 

Защитите своё время и нервы!

Lirum Device Info is the most complete and elegant application to retrieve real time status of your device. You will be able to monitor its performance, compare its specifications with other models and watch feedback from your device's sensors (magnetometer, accelerometer, gyroscope, GPS). Check out real battey status, voltage and wear level.

Universal App for iPad/iPod Touch/iPhone

EXCLUSIVE FEATURES:
- Apple Watch Support - Displays phone diagnostics right on your watch! (Displays data from your iPhone on the Apple Watch, not the other way around)
- Hardware Browser - Shows hardware tree of components inside the iOS Device;
- Bluetooth LE Scanner - Shows Bluetooth LE devices in range and broadcasted data and signal strength;
- Comparison of iPads, iPhones and iPod Touch generations (Resolution, Dimensions, Features, etc);
- Real-time multicore optimized CPU Usage Monitor;
- Memory allocation graph with "Force Memory Release" option;
- Real-time graph of the Accelerometer/Magnetometer/Gyroscope/Barometer sensors;
- GPS Receiver status data;
- Hardware tests for Vibration/Flashlight features (on iPhones);
- Touchscreen/LCD Color and Contrast tests;

OTHER FEATURES:
- Dimensions shown in american (imperial) or metric units (configurable);
Hundreds of specifications, such as:

Display
- Size, Resolution, Pixels Count, Pixels Density, Aspect Ratio, Color Depth, Amount of Colours, Contrast Ratio;
- Display Type, GPU Model, Number of GPU Cores, Latest OpenGL Version supported by the GPU;
- Width, Height, Depth, Weight;
CPU Informations
- Real time multicore CPU graph;
- CPU Name;
- Number of Cores;
- CPU Core Base;
- CPU Clock, Maximum Clock, Current Clock (when variable);
- Manufacturing Process;
- CPU Pipeline Depth;
- Cache L1, L2;
- Instruction Set;
- CPU Issue Width;
- Out of Order Execution Feature;
- "Designed by" and "Manufactured by" Information;
System Data
- Real time Memory Allocation graph;
Connectivity
- Wireless IP;
- Cellular network IP;
- Support for Wifi 802.11b,g,n;
- Bluetooth Version;
- Bluetooth A2DP, PBAB Profile, PAN, HID, HFP, EDR, AVRCP;
- Frequencies for 2G and 3G GSM/CDMA Bands;
- LTE (4G) Bands and Frequencies;
- LTE Maximum Download/Upload Speed;
- SIM Card Format / Slot;
Camera
- Both Cameras Resolution in Megapixels or in Pixels Resolution (width x height);
- Both Cameras Pixels Count/Focal Ratio;
- Tap to Focus/Macro/White Balance/IR Filter/Geo Tagging Support;
- Face Detection/Flash/HDR Features;
- Video Recording Resolution/Frames per Second count/Video Light/Stabilisation;
Battery
- Estimated Duration for: Browsing on Wifi, Browsing on 3G, Talking in 3G (iPhone only), Audio and Video Playback, GPS Navigation, Book reading and Standby;
- Battery Type and Capacity in mAh;
- Amount of Energy in W.h and Joules;
- Battery Voltage (when fully charged);
Sensors
- GPS Receiver Data (Latitude and Longitude in both decimal and Degrees, Speed, Accuracy, Altitude, Last Time Updated);
- Real-time Accelerometer/Magnetometer/Gyroscope monitors;
- Presence of Gyroscope, Proximity Sensor, Ambient Light Sensor, Accelerometer, A-GPS Receiver, GLONASS Receiver and Digital Compass;
Other Informations
- Operating and Non operating Temperatures;
- Maximum operating Altitudes;
- Relative humidity;
- Specific Absorption Rate (FCC US and Council of the European Union);
Compare Devices
- Allows the user to compare and export all of the information above;

